import { ComponentMeta, ComponentStory } from "@storybook/react";
import Heading from "./Heading";

export default {
  title: "Components/Text",
  component: Heading,
} as ComponentMeta<typeof Heading>;

export const Headings: ComponentStory<typeof Heading> = () => {
  return (
    <>
      <Heading type="h1" font="primary">Heading 1</Heading>;
      <Heading type="h2" font="primary"></Heading>;
      <Heading type="h1" font="secondary"></Heading>;
      <Heading type="h2" font="secondary"></Heading>;
    </>
  );
};



